import React from 'react';
import { Link } from 'react-router-dom'; // Import Link correctly

const Cards = ({ detail }) => {
  return (
    <div className='meals'>
      {
        !detail ? "Sorry Data Not Found" : detail.map((curItem) => {
          return (
            <div className='mealImg' key={curItem.dishId}> {/* Use dishId for key */}
              <img src={curItem.image} alt={curItem.title} />
              <p>{curItem.title}</p>
              <Link to={`/state/${stateId}/dishes/${dish.id}`}>
                <img src={curItem.image} alt={curItem.name} />
              </Link>
            </div>
          );
        })
      }
    </div>
  );
}

export default Cards;
